// ==UserScript==
// @name         小红书助手
// @namespace    http://tampermonkey.net/
// @version      0.4
// @description  小红书探索页面增强工具
// @match        http*://xhslink.com/*
// @icon         data:image/png;base64,
// @match        http*://www.xiaohongshu.com/explore*
// @match        http*://www.xiaohongshu.com/user/profile/*
// @match        http*://www.xiaohongshu.com/search_result*
// @grant        unsafeWindow
// @grant        GM_download
// @grant        GM_xmlhttpRequest
// @author       wujiafa azyasaxi
// @updateURL    https://raw.githubusercontent.com/wujiafanihao/xhs-azyasaxi/refs/heads/main/xhs_update.js
// @downloadURL  https://raw.githubusercontent.com/wujiafanihao/xhs-azyasaxi/refs/heads/main/xhs_update.js
// ==/UserScript==

(function () {
    'use strict';

    // 使用 unsafeWindow 访问页面的全局变量
    const win = typeof unsafeWindow !== 'undefined' ? unsafeWindow : window;

    // 创建样式
    const style = document.createElement('style');
    style.textContent = `
#xhs-helper {
    position: fixed;
    left: -60px;
    top: 50%;
    transform: translateY(-50%);
    transition: left 0.5s cubic-bezier(0.175, 0.885, 0.32, 1.275);
    z-index: 9999;
}

#xhs-helper:hover {
    left: 0;
}

#xhs-helper-button {
    width: 100px;
    height: 100px;
    background-color: #ff2442;
    border-radius: 0 60px 60px 0;
    display: flex;
    justify-content: flex-end;
    align-items: center;
    cursor: pointer;
    overflow: hidden;
    box-shadow: 2px 2px 10px rgba(0, 0, 0, 0.2);
    transition: all 0.3s ease;
}

#xhs-helper-button:hover {
    background-color: #ff3d5a;
}

#xhs-helper-icon {
    width: 50px;
    height: 50px;
    margin-right: 20px;
    background-image: url('data:image/svg+xml;utf8,<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 100 100"><circle cx="50" cy="50" r="45" fill="none" stroke="white" stroke-width="5"/><path d="M50,5 Q72.5,27.5 95,50 Q72.5,72.5 50,95 Q27.5,72.5 5,50 Q27.5,27.5 50,5 Z" fill="white"/></svg>');
    transition: transform 0.5s cubic-bezier(0.68, -0.55, 0.27, 1.55);
}

#xhs-helper:hover #xhs-helper-icon {
    transform: rotate(180deg);
}

#xhs-helper-menu {
    display: none;
    position: absolute;
    left: 100px;
    top: 0;
    width: 200px;
    background-color: white;
    border-radius: 10px;
    box-shadow: 0 5px 15px rgba(0,0,0,0.1);
    color: black;
    opacity: 0;
    transform: translateX(-20px);
    transition: opacity 0.3s ease, transform 0.3s ease;
}

#xhs-helper:hover #xhs-helper-menu {
    display: block;
    opacity: 1;
    transform: translateX(0);
}

.xhs-helper-item {
    padding: 15px;
    cursor: pointer;
    transition: background-color 0.3s, transform 0.2s;
}

.xhs-helper-item:hover {
    background-color: #f0f0f0;
    transform: translateX(5px);
}

.xhs-helper-item:first-child {
    border-radius: 10px 10px 0 0;
}

.xhs-helper-item:last-child {
    border-radius: 0 0 10px 10px;
}

.xhs-helper-item:active {
    transform: scale(0.98);
}
    `;
    document.head.appendChild(style);

    // 创建 HTML 结构
    const helper = document.createElement('div');
    helper.id = 'xhs-helper';
    helper.innerHTML = `
    <div id="xhs-helper-button">
        <div id="xhs-helper-icon"></div>
    </div>
    <div id="xhs-helper-menu">
        <div class="xhs-helper-item" id="all-note-info">获取搜索页面目前文章</div>
            </div>
    `;
    document.body.appendChild(helper);

    //一键获取
    document.getElementById('all-note-info').addEventListener('click', async () => {
        const optionContainer = document.createElement('div');
        optionContainer.style.cssText = `
            position: fixed;
            top: 100px;
            right: -300px;
            width: 280px;
            background-color: #0a192f;
            border: 1px solid #64ffda;
            border-radius: 10px;
            box-shadow: 0 0 20px rgba(100, 255, 218, 0.3);
            padding: 20px;
            zIndex: 1002;
            transition: right 0.5s cubic-bezier(0.68, -0.55, 0.27, 1.55);
            color: #64ffda;
            font-family: 'Roboto', sans-serif;
        `;
        document.body.appendChild(optionContainer);

        setTimeout(() => {
            optionContainer.style.right = '10px';
        }, 100);

        const createLabel = (text) => {
            const label = document.createElement('label');
            label.textContent = text;
            label.style.cssText = `
                display: block;
                margin-bottom: 10px;
                font-size: 14px;
                color: #8892b0;
            `;
            return label;
        };

        const createInput = (type, placeholder) => {
            const input = document.createElement('input');
            input.type = type;
            input.placeholder = placeholder;
            input.style.cssText = `
                display: block;
                width: 100%;
                margin-bottom: 15px;
                padding: 10px;
                background-color: #172a45;
                border: 1px solid #64ffda;
                border-radius: 5px;
                color: #64ffda;
                font-size: 14px;
                transition: all 0.3s ease;
            `;
            return input;
        };

        const filterLabel = createLabel('匹配字符获取:');
        const filterInput = createInput('text', '以|分割多个关键词');
        
        const timeRangeLabel = createLabel('评论时间范围（天）:');
        const timeRangeInput = createInput('number', '30');
        timeRangeInput.value = '30';
        timeRangeInput.min = '1';

        const filterButton = document.createElement('button');
        filterButton.textContent = '筛选获取，以|分割';
        filterButton.style.cssText = `
            display: block;
            width: 100%;
            padding: 10px;
            border: 1px solid #64ffda;
            background-color: transparent;
            color: #64ffda;
            border-radius: 5px;
            cursor: pointer;
            transition: all 0.3s ease;
            font-size: 16px;
            text-transform: uppercase;
            letter-spacing: 1px;
        `;

        // 添加悬停效果
        filterButton.addEventListener('mouseover', () => {
            filterButton.style.backgroundColor = 'rgba(100, 255, 218, 0.1)';
            filterButton.style.transform = 'translateY(-2px)';
        });
        filterButton.addEventListener('mouseout', () => {
            filterButton.style.backgroundColor = 'transparent';
            filterButton.style.transform = 'translateY(0)';
        });

        const progressContainer = document.createElement('div');
        progressContainer.style.cssText = `
            width: 100%;
            height: 5px;
            background-color: #172a45;
            margin-top: 15px;
            border-radius: 5px;
            overflow: hidden;
        `;

        const progressBar = document.createElement('div');
        progressBar.style.cssText = `
            width: 0%;
            height: 100%;
            background-color: #64ffda;
            transition: width 0.3s ease;
        `;

        progressContainer.appendChild(progressBar);

        optionContainer.appendChild(filterLabel);
        optionContainer.appendChild(filterInput);
        optionContainer.appendChild(timeRangeLabel);
        optionContainer.appendChild(timeRangeInput);
        optionContainer.appendChild(filterButton);
        optionContainer.appendChild(progressContainer);

        filterButton.addEventListener('click', async () => {
            const filterKeywords = filterInput.value.split('|').map(keyword => keyword.trim());
            const timeRange = parseInt(timeRangeInput.value, 10) || 30;
            await fetchNotes(filterKeywords, timeRange, progressBar);
            document.body.removeChild(optionContainer);
        });

        function infosimulateScroll() {
            return new Promise((resolve) => {
                let lastHeight = 0;
                let noChangeCount = 0;
                const maxNoChangeCount = 5;
                const scrollInterval = 500;  // 滚动间隔时间（毫秒）
                const heightCheckInterval = 200;  // 高度检查间隔（毫秒）

                function checkHeight() {
                    const currentHeight = document.documentElement.scrollHeight;
                    if (currentHeight > lastHeight) {
                        console.log(`新内容加载中，当前高度: ${currentHeight}`);
                        lastHeight = currentHeight;
                        noChangeCount = 0;
                        window.scrollTo(0, currentHeight);
                        setTimeout(checkHeight, heightCheckInterval);
                    } else {
                        noChangeCount++;
                        if (noChangeCount >= maxNoChangeCount) {
                            console.log("检测到页面高度不再变化，停止滚动");
                            resolve();
                        } else {
                            console.log(`高度未变化，继续检查 (${noChangeCount}/${maxNoChangeCount})`);
                            setTimeout(checkHeight, scrollInterval);
                        }
                    }
                }

                window.scrollTo(0, document.documentElement.scrollHeight);
                setTimeout(checkHeight, heightCheckInterval);
            });
        }

        async function fetchNotes(filterKeywords, timeRange, progressBar) {
            await infosimulateScroll();
            const allFilteredComments = [];

            const extractNoteInfo = (iframeWindow) => {
                return new Promise((resolve) => {
                    const checkInitialState = () => {
                        if (iframeWindow && iframeWindow.__INITIAL_STATE__) {
                            const noteId = iframeWindow.location.pathname.split('/').pop();
                            console.log(noteId)
                            console.log(iframeWindow.__INITIAL_STATE__)
                            if (iframeWindow.__INITIAL_STATE__.note && iframeWindow.__INITIAL_STATE__.note.noteDetailMap && iframeWindow.__INITIAL_STATE__.note.noteDetailMap[noteId]) {
                                resolve(iframeWindow.__INITIAL_STATE__.note.noteDetailMap[noteId]);
                            } else {
                                console.error("无法在__INITIAL_STATE__中找到noteDetailMap或特定noteId");
                                resolve(null);
                            }
                        } else {
                            // 如果还没加载完，等待一段时间后再次检查
                            setTimeout(checkInitialState, 100);
                        }
                    };
                    checkInitialState();
                });
            };

            const extractAllNoteInfo = () => {
                if (win.__INITIAL_STATE__ && win.__INITIAL_STATE__.search && win.__INITIAL_STATE__.search.feeds && win.__INITIAL_STATE__.search.feeds._rawValue) {
                    return win.__INITIAL_STATE__.search.feeds._rawValue;
                }
                console.error("无法从全局window获取__INITIAL_STATE__或search.feeds");
                return null;
            };

            const extractCommentDetails = (noteInfo, filterKeywords, timeRange) => {
                if (noteInfo && noteInfo.comments && noteInfo.comments.list) {
                    const currentTime = noteInfo.currentTime;
                    const comments = noteInfo.comments.list.map(comment => {
                        const timeDifference = calculateTimeDifference(comment.createTime, currentTime);
                        const daysDifference = Math.floor((currentTime - comment.createTime) / (1000 * 60 * 60 * 24));
                        return {
                            content: comment.content,
                            createTime: comment.createTime,
                            timeDifference: timeDifference,
                            daysDifference: daysDifference, // 新增：将天数差添加到返回对象中

                            userInfo: {
                                nickname: comment.userInfo.nickname,
                                userId: comment.userInfo.userId
                            }
                        };
                    }).filter(comment => {
                        if (comment.daysDifference > timeRange) {
                            return false;
                        }
                        if (filterKeywords.length === 0) return true;
                        return filterKeywords.some(keyword => comment.content.includes(keyword));
                    });
                    const noteDetails = {
                        title: noteInfo.note.title
                    };

                    return {
                        comments,
                        currentTime,
                        noteDetails
                    };
                } else {
                    console.error("comments 或 list 未定义");
                    return {
                        comments: [],
                        noteDetails: {}
                    };
                }
            };

            function calculateTimeDifference(createTime, currentTime) {
                const diff = currentTime - createTime;
                const minutes = Math.floor(diff / 60000);
                const hours = Math.floor(minutes / 60);
                const days = Math.floor(hours / 24);

                if (days > 0) return `${days}天前`;
                if (hours > 0) return `${hours}小时前`;
                if (minutes > 0) return `${minutes}分钟前`;
                return '刚刚';
            }

            const extractAndAccumulateDetails = async (iframeWindow, filterKeywords, timeRange) => {
                const noteInfo = await extractNoteInfo(iframeWindow);
                console.log(noteInfo);
                if (noteInfo) {
                    const details = extractCommentDetails(noteInfo, filterKeywords, timeRange);
                    if (details.comments.length > 0) {
                        // 添加笔记标题到每条评论
                        const commentsWithTitle = details.comments.map(comment => ({
                            ...comment,
                            noteTitle: details.noteDetails.title
                        }));
                        allFilteredComments.push(...commentsWithTitle);
                    } else {
                        console.log("笔记评论为空，跳过保存操作");
                    }
                } else {
                    console.error("无法获取笔记信息");
                }
            };

            async function simulateUserPageVisit(userId) {
                return new Promise((resolve, reject) => {
                    const url = `https://www.xiaohongshu.com/user/profile/${userId}`;
                    const iframe = document.createElement('iframe');
                    iframe.style.display = 'none';
                    iframe.src = url;
                    document.body.appendChild(iframe);
    
                    iframe.onload = () => {
                        try {
                            const userInfo = iframe.contentWindow.__INITIAL_STATE__.user.userPageData._rawValue;
                            const extractedInfo = extractUserDetails(userInfo);
                            document.body.removeChild(iframe);
                            resolve(extractedInfo);
                        } catch (error) {
                            document.body.removeChild(iframe);
                            reject(error);
                        }
                    };
    
                    iframe.onerror = (error) => {
                        document.body.removeChild(iframe);
                        reject(error);
                    };
    
                    setTimeout(() => {
                        if (document.body.contains(iframe)) {
                            document.body.removeChild(iframe);
                            reject(new Error(`提取用户 ${userId} 信息超时`));
                        }
                    }, 10000);
                });
            }
    
            function extractUserDetails(userInfo) {
                if (userInfo && userInfo.basicInfo && userInfo.basicInfo.redId) {
                    const basicInfo = userInfo.basicInfo;
                    return {
                        gender: basicInfo.gender === 1 ? '女' : '男',
                        redId: basicInfo.redId,
                    };
                }
                return null;
            }

            const saveAllToCSV = async (comments, timeRange) => {
                let csvContent = "\uFEFF内容,发布时间,时间差,用户昵称,用户ID,小红书ID,性别,笔记标题\n";
                const uniqueUserIds = new Set();

                // 收集符合条件的用户ID
                comments.forEach(comment => {
                    if (comment.daysDifference <= timeRange) {
                        uniqueUserIds.add(comment.userInfo.userId);
                    }
                });

                // 创建用户信息获取进度条容器
                const userProgressContainer = document.createElement('div');
                userProgressContainer.style.cssText = `
                    position: fixed;
                    top: 20px;
                    left: 50%;
                    transform: translateX(-50%);
                    width: 300px;
                    background-color: #0a192f;
                    border: 1px solid #64ffda;
                    border-radius: 10px;
                    padding: 15px;
                    z-index: 1000;
                    box-shadow: 0 0 20px rgba(100, 255, 218, 0.3);
                    font-family: 'Arial', sans-serif;
                `;

                const progressText = document.createElement('div');
                progressText.textContent = '正在获取用户信息...';
                progressText.style.cssText = `
                    color: #64ffda;
                    margin-bottom: 10px;
                    font-size: 14px;
                    text-align: center;
                `;

                const userProgressBar = document.createElement('div');
                userProgressBar.style.cssText = `
                    width: 100%;
                    height: 5px;
                    background-color: #172a45;
                    border-radius: 5px;
                    overflow: hidden;
                `;

                const userProgressFill = document.createElement('div');
                userProgressFill.style.cssText = `
                    width: 0%;
                    height: 100%;
                    background-color: #64ffda;
                    transition: width 0.3s ease;
                `;

                userProgressBar.appendChild(userProgressFill);
                userProgressContainer.appendChild(progressText);
                userProgressContainer.appendChild(userProgressBar);
                document.body.appendChild(userProgressContainer);

                // 获取用户详细信息
                const userDetailsMap = new Map();
                let processedUsers = 0;
                for (const userId of uniqueUserIds) {
                    try {
                        const userDetails = await simulateUserPageVisit(userId);
                        if (userDetails) {
                            userDetailsMap.set(userId, userDetails);
                        }
                    } catch (error) {
                        console.error(`获取用户 ${userId} 信息失败:`, error);
                    }
                    processedUsers++;
                    // 更新用户信息获取进度条
                    const progress = (processedUsers / uniqueUserIds.size) * 100;
                    userProgressFill.style.width = `${progress}%`;
                    progressText.textContent = `正在获取用户信息... ${Math.round(progress)}%`;
                }

                // 移除用户信息获取进度条
                setTimeout(() => {
                    document.body.removeChild(userProgressContainer);
                }, 2000);

                // 生成CSV内容
                for (const comment of comments) {
                    if (comment.daysDifference <= timeRange) {
                        const userDetails = userDetailsMap.get(comment.userInfo.userId) || { redId: 'N/A', gender: 'N/A' };
                        csvContent += `"${comment.content.replace(/"/g, '""')}","${comment.createTime}","${comment.timeDifference}","${comment.userInfo.nickname.replace(/"/g, '""')}","${comment.userInfo.userId}","${userDetails.redId}","${userDetails.gender}","${comment.noteTitle.replace(/"/g, '""')}"\n`;
                    }
                }

                downloadCSV(csvContent, `filtered_comments.csv`);
            };

            const downloadCSV = (content, filename) => {
                const blob = new Blob([content], { type: 'text/csv;charset=utf-8;' });
                const link = document.createElement("a");
                if (link.download !== undefined) {
                    const url = URL.createObjectURL(blob);
                    link.setAttribute("href", url);
                    link.setAttribute("download", filename);
                    link.style.visibility = 'hidden';
                    document.body.appendChild(link);
                    link.click();
                    document.body.removeChild(link);
                }
            };

            function simulateScroll(iframeDocument) {
                return new Promise((resolve) => {
                    const noteContainer = iframeDocument.getElementById('noteContainer');
                    if (!noteContainer) {
                        console.error("未找到目标元素");
                        resolve();
                        return;
                    }

                    let previousHeight = 0;
                    let noChangeCount = 0;
                    const maxNoChangeCount = 5;
                    const scrollStep = 5000; // 每次滚动的步长
                    const waitTime = 1250; // 每次滚动后等待的时间

                    const scrollPage = () => {
                        if (shouldStop) {
                            clearInterval(scrollInterval);
                            resolve();
                            return;
                        }
                        noteContainer.scrollTop += scrollStep;
                        const currentHeight = noteContainer.scrollHeight;

                        console.log(`当前高度: ${currentHeight}, 之前高度: ${previousHeight}`);

                        if (currentHeight > previousHeight) {
                            previousHeight = currentHeight;
                            noChangeCount = 0; // 重置不变计数
                        } else {
                            noChangeCount++;
                            console.log(`高度未变化次数: ${noChangeCount}`);
                            if (noChangeCount >= maxNoChangeCount) {
                                clearInterval(scrollInterval);
                                console.log("达到最大不变次数，开始提取数据");
                                resolve();
                            }
                        }
                    };

                    const scrollInterval = setInterval(scrollPage, waitTime);
                });
            }

            let shouldStop = false; // 全局状态，用于控制是否停止获取笔记

            async function simulateNotePageVisit(noteId, index, total, filterKeywords, timeRange) {
                return new Promise((resolve, reject) => {
                    if (shouldStop) {
                        resolve();
                        return;
                    }

                    const url = `https://www.xiaohongshu.com/explore/${noteId}`;
                    const container = document.createElement('div');
                    container.className = 'note-scroller';
                    container.style.cssText = `
                        position: fixed;
                        top: 50px;
                        right: -510px;
                        width: 500px;
                        height: 80vh;
                        background-color: #0a192f;
                        border: 1px solid #64ffda;
                        border-radius: 10px;
                        box-shadow: 0 4px 20px rgba(100, 255, 218, 0.3);
                        padding: 20px;
                        z-index: 1001;
                        overflow: hidden;
                        transition: right 0.5s cubic-bezier(0.68, -0.55, 0.27, 1.55);
                        font-family: 'Roboto', 'Arial', sans-serif;
                        color: #64ffda;
                    `;
                    document.body.appendChild(container);

                    // 使用 setTimeout 来触发动画
                    setTimeout(() => {
                        container.style.right = '10px';
                    }, 100);

                    const title = document.createElement('h3');
                    title.textContent = `模拟访问笔记 ${index + 1}/${total}`;
                    title.style.cssText = `
                        margin: 0 0 15px 0;
                        font-size: 18px;
                        font-weight: 500;
                        color: #64ffda;
                    `;
                    container.appendChild(title);

                    const iframe = document.createElement('iframe');
                    iframe.style.cssText = `
                        width: 100%;
                        height: calc(100% - 70px);
                        border: none;
                        border-radius: 5px;
                        transition: opacity 0.3s ease;
                    `;
                    iframe.src = url;

                    const closeButton = document.createElement('button');
                    closeButton.textContent = '终止并关闭';
                    closeButton.style.cssText = `
                        position: absolute;
                        top: 15px;
                        right: 15px;
                        padding: 5px 10px;
                        border: none;
                        background-color: #ff4d4d;
                        color: white;
                        border-radius: 5px;
                        cursor: pointer;
                        font-size: 14px;
                        transition: all 0.3s ease;
                    `;
                    closeButton.onmouseover = () => {
                        closeButton.style.backgroundColor = '#ff6666';
                        closeButton.style.transform = 'translateY(-2px)';
                    };
                    closeButton.onmouseout = () => {
                        closeButton.style.backgroundColor = '#ff4d4d';
                        closeButton.style.transform = 'translateY(0)';
                    };
                    closeButton.onclick = () => {
                        shouldStop = true;
                        clearInterval(scrollInterval);
                        container.style.right = '-510px';
                        setTimeout(() => {
                            document.body.removeChild(container);
                        }, 500);
                        resolve();
                    };

                    container.appendChild(closeButton);
                    container.appendChild(iframe);

                    let scrollInterval;

                    iframe.onload = async () => {
                        iframe.style.opacity = '1';
                        const iframeWindow = iframe.contentWindow;
                        const iframeDocument = iframeWindow.document;

                        scrollInterval = await simulateScroll(iframeDocument);

                        await extractAndAccumulateDetails(iframeWindow, filterKeywords, timeRange);

                        setTimeout(() => {
                            container.style.right = '-510px';
                            setTimeout(() => {
                                document.body.removeChild(container);
                                resolve();
                            }, 500);
                        }, 2000);
                    };

                    iframe.onerror = (err) => {
                        console.error("加载 iframe 失败", err);
                        container.style.right = '-510px';
                        setTimeout(() => {
                            document.body.removeChild(container);
                            reject(err);
                        }, 500);
                    };
                });
            }

            const allNotes = extractAllNoteInfo();
            if (allNotes && allNotes.length > 0) {
                for (let i = 0; i < allNotes.length; i++) {
                    const note = allNotes[i];
                    console.log(note.id);
                    await simulateNotePageVisit(note.id, i, allNotes.length, filterKeywords, timeRange);
                    // 更新进度条
                    progressBar.style.width = `${((i + 1) / allNotes.length) * 100}%`;
                }
                // 在所有笔记处理完成后保存所有过滤后的评论到一个CSV文件
                if (allFilteredComments.length > 0) {
                    saveAllToCSV(allFilteredComments, timeRange);
                    console.log(`所有 ${timeRange} 天内的过滤后评论已保存到 关键用户评论.csv`);
                } else {
                    console.log("没有匹配的评论。");
                }
            } else {
                console.error("未获取到笔记信息");
            }
        }
    });
})();
